
    <Style>
        body {
            background: linear-gradient(-45deg, #ffffff, #e6e6e6, #ffffff, #e7e7e7);
            background-size: 400% 400%;
            animation: gradient 15s ease infinite;
        }

        @keyframes gradient {
            0% {
                background-position: 0% 50%;
            }

            50% {
                background-position: 100% 50%;
            }

            100% {
                background-position: 0% 50%;
            }
        }


        #cons {
            position: relative;
            right: 0;
            bottom: 0;
            display: flex;
            align-items: center;
            justify-content: space-evenly;
            padding: 10px;
            background: #fff;
            border-radius: 10px;
            margin-bottom: 10px;
        }

        .box {
            position: relative;
            width: 40px;
            height: 40px;
            text-align: center;
            line-height: 1.2;
            border-radius: 50%;
            font-size: 14px;
            color: #fff;
            display: flex;
            align-items: center;
            justify-content: center;
            font-weight: bold;
        }

        #box1 {
            background-color: rgb(25, 0, 255);
            top: 0px;
        }

        #box2 {
            background-color: rgb(65, 65, 65);
            top: 0px;
        }

        #box3 {
            background-color: rgb(0, 0, 0);
            top: 0px;
        }

        #box4 {
            background-color: rgb(255, 0, 119);
            top: 0px;
        }

        #box5 {
            background-color: rgb(209, 1, 1);
            top: 0px;
        }

        #box6 {
            background-color: rgb(158, 0, 79);
            top: 0px;
        }

        a {
            color: white;
        }

        .highlight {
            border: 1px solid yellow;
            width: 30px;
            height: 30px;
            font-size: 10px;
        }

        code {
            color: white;
            font-size: 1.2em;
        }



        .dropArea {
     
    background:#fff;
            position: relative;
            left: 0px;
            top: 0;
            color: black;
            
            margin-top: 50PX;
            border-radius:5px ;
        }

        .right-sec .table {
            background: #003061;
            color: #fff;
        }

        path {
            cursor: pointer;
        }

        path:hover {
            stroke: #fff;
            stroke-width: 1;
            -webkit-transition: all .5s ease-out;
            -moz-transition: all .5s ease-out;
            -o-transition: all .5s ease-out;
            transition: all .5s ease-out;
        }

        .total-map {
            /* display: flex;
            align-items: flex-start; */
            position: relative;
        }

        .right-sec {
            /* padding: 50px 0px 0 50px; */
            position: relative;
            /* width: 40%; */
        }

        .right-sec .table td {
            width: 40px;
        }


        .kalpan-game {
            padding: 25px 0;
        }

        .kalpan-game .row{
            align-items: center;

        }  
        

        tr.tale-hdr th {
            background: #016c6c;
        }

        .r-cptl {
            background: red;
            width: 100px;
            height: 100px;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 12px;
            border-radius: 50%;
            padding: 10px;           
        }

        .r-cptl p {
            display: table;
            margin: 0;
            width: auto;
            text-align: center;
            color: #fff;
            font-weight: bold;
        }

        .t-r {
            position: absolute;
            right: 20px;
            top: 20px;
        }

        .l-b {
            position: absolute;
            bottom: 20px;
            left: 20px;         
        }
        
        input.fill-btn {
            width: 100%;
            background: #000b93;
            border: none;
            text-align: center;
            padding: 10px;
            margin: 0;
            color: #fff;
            text-transform: capitalize;
            font-weight: 600;
            cursor: pointer;
        }


    </Style>
